import { Link } from "react-router-dom";
import classes from './Headerthingys.module.css';
const SellIcon = () => {
    return (
        <div className="Sellbox">
            <button className="SellLink">
                <Link to='/post-ad'>
                <strong>SELL</strong>
                </Link>
            </button>
        </div>
    );
}

export default SellIcon;
